import React from 'react';
import Chess from 'react-chess';

function App() {
  return (
    <div >

      <div style={{ height: window.screen.height / 2 }}>

        <Chess />
      </div>
      <div style={{ height: window.screen.height / 2 }}>
        Hello
      </div>
    </div>
  );
}

export default App;
